import React, { Component } from 'react';
import { Card, CardBody, Row, Col } from 'reactstrap';

class Home extends Component {

    render() {
      return (
          <div className="animated fadeIn">
        <Row >
            <Col >
                <img  src='https://pictures.dealer.com/f/familyfordfd/1854/e7964eb78d5d1f80aa93981b84d395bfx.jpg' class="img-fluid justify-content-center" alt="Responsive image"></img>
        </Col>
        </Row>
        <Row>
            <Col>
            <Card>
                <CardBody><p>Hello world, This is the home page</p></CardBody>                    
            </Card>
            </Col>
        </Row>

        </div>
    );
    }
  }
  
  
  export default Home;
